        chartsArr: Array<any> = [];
        tags: Array<tagData> = [
            {position: 500, type: 'S'},
            {position: 4000, type: 'V'},
            {position: 11000, type: 'V'},
            {position: 13000, type: 'F'},
        ];
        tagData: Array<tagDataLine>;
        maxLineIndex: number = this.data.length - 1;//tag最大的偏移序号
        updateState: boolean = false;//tag的编辑状态
        currentUpdatexAxis: string = "";//编辑tag的横坐标
        addTagIndex: string = "";//新添加tag的横坐标
        startTime: number = 0;
        endTime: number = 0;//以上两个变量用于控制按键速度
        currentRow: number = 0;//当前在操作的行数
        tagLabels: Array<String> = ["N-正常心搏", "S-房性早搏", "V-室性早搏", "F-心室融合心跳", "Q-未分类心跳"]; //节拍描述选项
        newLabel: string = "";
        labelMap: Array<string> = ['N', 'S', 'V', 'F', 'Q'];
        addState: boolean = false;
        rhythmStartState: boolean = false;
        rhythmEndState: boolean = false;
        rhythmStart: string = '';
        rhythmEnd: string = '';

        resetStatus(currentRow?:number) {
            this.updateState = false;
            this.currentUpdatexAxis = "";
            this.tagData = this.tagData.map(e => {
                return {
                    xAxis: e.xAxis,
                    label: {
                        formatter: e.label.formatter
                    }
                }
            });
            this.drawMarkLine(currentRow);
        }

        addRhythmStart() {
            this.resetStatus();
            this.rhythmStartState = true;
        }

        rhythmFinished() {
            this.rhythmEndState = true;
        }

        deleteTag() {
            if (this.updateState) {
                this.tagData = this.tagData.filter((e: tagDataLine) => {
                    return e.xAxis !== this.currentUpdatexAxis
                });
                this.drawMarkLine(this.currentRow);
            }
        }

        addLine() {
            this.addState = true;
            this.tagData.push({
                xAxis: this.addTagIndex,
                label: {
                    formatter: ''
                }
            });
            this.tagData = Constants.distinct(this.tagData, e => e.xAxis);
            let currentRow = Math.floor(Number(this.addTagIndex.split('index')[1]) / 3000);
            this.drawMarkLine(currentRow);
        }

        upDateLabel() {
            if (this.updateState) {
                let currentLabelIndex = this.tagLabels.indexOf(this.newLabel);
                this.tagData = this.tagData.map(e => {
                    if (e.xAxis === this.currentUpdatexAxis) {
                        return {
                            xAxis: e.xAxis,
                            label: {
                                formatter: this.labelMap[currentLabelIndex]
                            }
                        }
                    } else {
                        return {
                            xAxis: e.xAxis,
                            label: {
                                formatter: e.label.formatter
                            }
                        }
                    }
                });
                this.drawMarkLine(this.currentRow);
                this.newLabel = '';
                this.resetStatus(this.currentRow);
            }
        }

        drawMarkLine(row?: number) {
            if (row) {
                let currentTag = this.tagData.filter((e: tagDataLine) => {
                    return Number(e.xAxis.split('index')[1]) >= row * 3000 && Number(e.xAxis.split('index')[1]) <= row * 3000 + 3000
                });
                this.chartsArr[row].setOption({
                    series: [
                        {
                            markLine: {
                                data: currentTag
                            }
                        }
                    ]
                });
                return
            }
            for (let i = 0; i < 5; i++) {
                let currentTag = this.tagData.filter((e: tagDataLine) => {
                    return Number(e.xAxis.split('index')[1]) >= i * 3000 && Number(e.xAxis.split('index')[1]) <= i * 3000 + 3000
                });
                this.chartsArr[i].setOption({
                    series: [
                        {
                            markLine: {
                                data: currentTag
                            }
                        }
                    ]
                });
            }
        }

        drawMarkArea() {
            let startRow=this.rowCompute(this.rhythmStart);
            let endRow=this.rowCompute(this.rhythmEnd);
            let startX=Number(this.rhythmStart.split('index')[1])-startRow*3000;
            let endX=Number(this.rhythmEnd.split('index')[1])-endRow*3000;
            if(startRow===endRow){
                this.chartsArr[startRow].setOption({
                    series: [
                        {
                            markArea: {
                                data: [
                                    [
                                        {
                                            name: '节律异常',
                                            xAxis: startX,
                                            yAxis: 'min'
                                        },
                                        {
                                            xAxis: endX,
                                            yAxis: 'max'
                                        }
                                    ]
                                ]
                            }
                        }
                    ]
                });
            }

            for(let i=startRow;i<=endRow;i++){
                if(i===startRow){
                    this.chartsArr[i].setOption({
                        series: [
                            {
                                markArea: {
                                    data: [
                                        [
                                            {
                                                name: '节律异常',
                                                xAxis: startX,
                                                yAxis: 'min'
                                            },
                                            {
                                                xAxis: 3000,
                                                yAxis: 'max'
                                            }
                                        ]
                                    ]
                                }
                            }
                        ]
                    });
                }else if(i===endRow){
                    this.chartsArr[i].setOption({
                        series: [
                            {
                                markArea: {
                                    data: [
                                        [
                                            {
                                                name: '节律异常',
                                                xAxis: 0,
                                                yAxis: 'min'
                                            },
                                            {
                                                xAxis: endX,
                                                yAxis: 'max'
                                            }
                                        ]
                                    ]
                                }
                            }
                        ]
                    });
                }else{
                    this.chartsArr[i].setOption({
                        series: [
                            {
                                markArea: {
                                    data: [
                                        [
                                            {
                                                name: '节律异常',
                                                xAxis: 0,
                                                yAxis: 'min'
                                            },
                                            {
                                                xAxis: 3000,
                                                yAxis: 'max'
                                            }
                                        ]
                                    ]
                                }
                            }
                        ]
                    });
                }
            }

        }
        rowCompute(xAxis:string){
            return Math.floor(Number(xAxis.split('index')[1])/3000);
        }
        moveLine(event: any) {
            this.startTime = new Date().getTime();
            if (this.endTime - this.startTime < -40) {//最快40ms执行一次，防止浏览器崩溃
                let currentLineIndex = Number(this.currentUpdatexAxis.split('index')[1]);
                if (event.keyCode === 39) {
                    if (currentLineIndex < this.currentRow * 3000 + 3000) {
                        currentLineIndex++;
                        this.tagData = this.tagData.map(e => {
                            if (e.lineStyle) {
                                return {
                                    xAxis: "index" + currentLineIndex, lineStyle: {
                                        color: "#666"
                                    },
                                    label: {
                                        formatter: e.label.formatter
                                    }
                                }
                            } else {
                                return {
                                    xAxis: e.xAxis,
                                    label: {
                                        formatter: e.label.formatter
                                    }
                                }
                            }
                        });
                        this.currentUpdatexAxis = "index" + currentLineIndex;
                        this.drawMarkLine(this.currentRow);
                    }
                }
                if (event.keyCode === 37) {
                    if (currentLineIndex > this.currentRow * 3000) {
                        currentLineIndex--;
                        this.tagData = this.tagData.map(e => {
                            if (e.lineStyle) {
                                return {
                                    xAxis: "index" + currentLineIndex, lineStyle: {
                                        color: "#666"
                                    },
                                    label: {
                                        formatter: e.label.formatter
                                    }
                                }
                            } else {
                                return {
                                    xAxis: e.xAxis,
                                    label: {
                                        formatter: e.label.formatter
                                    }
                                }
                            }
                        });
                        this.currentUpdatexAxis = "index" + currentLineIndex;
                        this.drawMarkLine(this.currentRow);
                    }
                }
                if (event.keyCode === 13) {
                    this.resetStatus(this.currentRow);
                }
                this.endTime = new Date().getTime();
            } else {
                event.preventDefault();
            }

        }

        drawEcg(row: number, ele: any) {
            //下面定义的变量都是代表其中某一行心电
            let xData: Array<string> = [];//x轴
            let xDataStart = row * 3000;
            for (let i = xDataStart, len = xDataStart + 3000; i < len; i++) {
                xData.push('index' + i);
            }
            let currentTagData = this.tags.filter(e => {
                return e.position >= Number(xData[0].split('index')[1]) && e.position <= Number(xData[xData.length - 1].split('index')[1])
            });
            //当前行的tags配置数组
            let tagData: Array<tagDataLine> = currentTagData.map(e => {
                return {
                    xAxis: "index" + e.position,
                    label: {
                        formatter: e.type
                    }
                }
            });
            let option = {
                title: {
                    text: '心电图' + row
                },
                tooltip: {
                    trigger: 'axis',
                    formatter: (param: any) => {
                        this.addTagIndex = param[0].axisValue;
                        return this.addTagIndex
                    },
                    triggerOn: 'click'
                },
                animation: false,
                xAxis: {
                    type: 'category',
                    boundaryGap: false,
                    data: xData
                },
                yAxis: {
                    type: 'value',
                    axisLine: {
                        show: false
                    },
                    axisTick: {
                        show: false
                    },
                    axisLabel: {
                        show: false
                    }
                },

                series: [
                    {
                        name: '心电图',
                        type: 'line',
                        data: this.data.slice(xDataStart, xDataStart + 3000),
                        markLine: {
                            data: tagData
                        },
                       /* markArea: {
                            data: [
                                [
                                    {
                                        name: '节律异常',
                                        xAxis: 1000,
                                        yAxis: 'min'
                                    },
                                    {
                                        xAxis: 2000,
                                        yAxis: 'max'
                                    }
                                ]
                            ]
                        }*/
                    }
                ]
            };
            ele.setOption(option);
            ele.on('click', (params: any) => {
                if (params.componentType !== "markLine") {
                    return
                }
                this.currentRow = row;
                //添加节律
                if (this.rhythmStartState) {
                    this.rhythmStart = params.value;
                    this.tagData = this.tagData.map((e: tagDataLine) => {
                        if (e.xAxis === params.value) {
                            return {
                                xAxis: e.xAxis, lineStyle: {
                                    color: "#2E34FF"
                                },
                                label: {
                                    formatter: e.label.formatter
                                }
                            }
                        } else {
                            return {
                                xAxis: e.xAxis,
                                label: {
                                    formatter: e.label.formatter
                                }
                            }
                        }
                    });
                    this.drawMarkLine();
                    this.rhythmStartState = false;
                    return
                }
                if (this.rhythmEndState) {
                    this.rhythmEnd = params.value;
                    this.tagData = this.tagData.map((e: tagDataLine) => {
                        if (e.xAxis === params.value ||e.xAxis===this.rhythmStart) {
                            return {
                                xAxis: e.xAxis, lineStyle: {
                                    color: "#2E34FF"
                                },
                                label: {
                                    formatter: e.label.formatter
                                }
                            }
                        } else {
                            return {
                                xAxis: e.xAxis,
                                label: {
                                    formatter: e.label.formatter
                                }
                            }
                        }
                    });
                    this.drawMarkLine();
                    this.drawMarkArea();
                    this.rhythmEndState = false;
                    this.resetStatus();
                    return
                }

                //下面是节拍编辑
                //如果两次点击同一根线，或者重新点击开启修改，则修改状态
                if (this.currentUpdatexAxis === '' || this.currentUpdatexAxis === params.value) {
                    this.updateState = !this.updateState;
                }
                this.currentUpdatexAxis = params.value;
                if (this.updateState) {
                    this.tagData = this.tagData.map((e: tagDataLine) => {
                        if (e.xAxis === params.value) {
                            return {
                                xAxis: e.xAxis, lineStyle: {
                                    color: "#666"
                                },
                                label: {
                                    formatter: e.label.formatter
                                }
                            }
                        } else {
                            return {
                                xAxis: e.xAxis,
                                label: {
                                    formatter: e.label.formatter
                                }
                            }
                        }
                    });
                    this.drawMarkLine();
                    document.addEventListener("keydown", this.moveLine);
                } else {
                    this.tagData = this.tagData.map(e => {
                        return {
                            xAxis: e.xAxis,
                            label: {
                                formatter: e.label.formatter
                            }
                        }
                    });
                    this.drawMarkLine();
                    this.currentUpdatexAxis = '';
                    document.removeEventListener("keydown", this.moveLine);
                }
            })
        }

        mounted() {
            this.tagData = this.tags.map(e => {
                return {
                    xAxis: "index" + e.position,
                    label: {
                        formatter: e.type
                    }
                }
            });
            for (let i = 0; i < 2; i++) {
                this.data = this.data.concat(this.data);
            }
            for (let i = 0; i < 5; i++) {
                this.chartsArr.push(echarts.init(document.getElementById('ecg-chart' + i)));
            }
            for (let i = 0; i < 5; i++) {
                this.drawEcg(i, this.chartsArr[i]);
            }
        }
    }
</script>

